import React from 'react';

function Error (){
return (
<div style={{ background: 'black', color: 'white', padding: '20px' }}>
<h1 style={{ margin: '0' }}>Error!!!</h1>
<h2 style={{ margin: '0' }}>Wrong Page</h2>
</div>
);
}

export default Error;
